function App() {
  return (
    <div className='App'>
      <Navbar />
      <Container maxWidth='lg'>
        <Grid container spacing={3}>
          <Grid item xs={12} sm={6} l={6}>
            <div className="new"></div>
          </Grid>
          <Grid item xs={12} sm={6} md={6}>
            <div className="new"></div>
          </Grid>
          <Grid item xs={12} sm={6} md={6}>
            <div className="new"></div>
          </Grid>
        </Grid>
      </Container>
    </div>
  );
}

export default App;
